import React from "react";
import classes from "./CardButton.module.css";
import CartIcon from "../Cart/CartIcon";

function CardButton() {
  return (
    <button>
      <span className={classes.icon}>
        <CartIcon />
      </span>
      <span> Your cart </span>
      <span className={classes.badge}> 3</span>
    </button>
  );
}

export default CardButton;
